public class LKM_Oracle_to_File_datapump extends GroovyComponentGeneratorDelegateBase {
        private static final String NEW_LINE = System.getProperty("line.separator");
        protected MapPhysicalNode physicalNode;

        private String extTableName;
        private String resourceName;
        private String compatible;
        private String parallelism;
        private String compression;
        private String compressionLevel;
        private String targetFileNames;

        public void setBinding(Binding binding) {

            Map variables = binding.getVariables();

            if (variables.containsKey("physicalNode")) {
              physicalNode =  binding.getVariable("physicalNode");
            }


            List<MapPhysicalNode> targetNodes = physicalNode.getDownstreamConnectedNodes();
            if (targetNodes == null || targetNodes.isEmpty()) {
                throw new RuntimeException("No target node");
            }
            MapPhysicalNode targetNode = targetNodes.get(0);
            oracle.odi.domain.model.OdiDataStore dataStore = (oracle.odi.domain.model.OdiDataStore)targetNode.getLogicalComponent().getBoundObject();
            resourceName = dataStore.getName();
            extTableName = "<?=odiRef.getObjectName(\"L\", \"%COL_PRF"+physicalNode.getStageTableName()+"_EXT\", \"W\")?>";
            String targetLocation = physicalNode.getExecutionUnit().getLocation().getLogicalSchema().getName();
            targetLocation = "<?=odiRef.getSchemaName(\"" + targetLocation + "\", \"D\")?>";
            compatible = getOptionValue("COMPATIBLE");

            parallelism = getOptionValue("PARALLEL_UNLOADERS").trim();
            if (parallelism.equals("")) parallelism = "1";

            targetFileNames = "<\\u0024 if ("+parallelism+" == 1)"+
                            "   out.print(\"  utl_file.fremove('DAT_DIR', '"+resourceName+".exp');\");"+
                            "else {"+
                            "   for (int i=0; i<"+parallelism+"; i++) {"+
                            "      out.println(\"  utl_file.fremove('DAT_DIR', '"+resourceName+"\"+i+\".exp');\");"+
                            "   }"+
                            "}"+
                            "\\u0024>";


            compression = getOptionValue("COMPRESSION");
            compressionLevel = getOptionValue("COMPRESSION_LEVEL");

            binding.setVariable("targetLocation", targetLocation);
            binding.setVariable("extTableName", extTableName);
            binding.setVariable("resourceName", resourceName);
            binding.setVariable("targetFileNames", targetFileNames);
         }

         String getOptionValue(String optionName) throws AdapterException,
                                                    GenerationException,
                                                    oracle.odi.domain.mapping.exception.MappingException {
            return physicalNode.getOptionValue(IKnowledgeModule.ProcessingType.SOURCE,
                                               optionName).getOptionValueString();

        }

        AbstractSyntaxTree EXTRACT_TAP(SqlQuery sqlQuery) throws AdapterException,
                                       oracle.odi.domain.mapping.exception.MappingException,
                                       GenerationException {
            NullTarget result = new NullTarget();
            result.setUpstreamAST(sqlQuery);
            return result;
        }

        SqlQuery getSqlQuery(SqlQuery sqlQuery, StringBuilder columnBuilder) {
           List<MapPhysicalColumn> columns = physicalNode.getPhysicalColumns();

           List<ISelectItem> newSelectList = new ArrayList<ISelectItem>();
           List<StringExpression> newAliasList = new ArrayList<StringExpression>();

           for (MapPhysicalColumn column : columns) {
              newSelectList.add(new ArrayExpression(column, sqlQuery));
              StringExpression aliasExpn = new StringExpression(column.getName(),column);
              newAliasList.add(aliasExpn);
              if (columnBuilder.length() > 0) {
                 columnBuilder.append(",").append(NEW_LINE).append("     ");
              }
              columnBuilder.append(aliasExpn.toString());
           }


           SqlQuery result = sqlQuery.clone();
           result.setSelectList(newSelectList);
           result.setAliasList(newAliasList);
           return result;
        }

        AbstractSyntaxTree LOAD_TAP(SqlQuery sqlQuery) throws AdapterException,
                                       oracle.odi.domain.mapping.exception.MappingException,
                                       GenerationException {

            SqlQuery extTblQuery = new SqlQuery(physicalNode.getTemplateUtils());

            StringBuilder columnBuilder = new StringBuilder();
            SqlQuery updatedQuery = getSqlQuery(sqlQuery, columnBuilder);
            ExternalTableDatapump extTableStatement = new ExternalTableDatapump(extTableName,
                                                                                resourceName,
                                                                                columnBuilder.toString(),
                                                                                "dat_dir",
                                                                                updatedQuery);


            extTableStatement.setOptions(compatible, parallelism, compression, compressionLevel);
            extTableStatement.setIsPushFromSource(true);
            return extTableStatement;

        }

        AbstractSyntaxTree PRE_EXTRACT_TAP(SqlQuery input) {
            NullTarget result = new NullTarget();
            result.setUpstreamAST(input);
            return result;
        }

    }


    public class ExternalTableDatapump extends AbstractSyntaxTree {

        private String externalTableName;
        private String dataStoreName;
        private String columnsDefinitions;
        private String directory;
        private String resourceNames;
        private String compatible;
        private String parallelUnloaders;
        private String compression;
        private String compressionLevel;

        SqlQuery sqlQuery;

        public ExternalTableDatapump(String externalTableName,
                                     String dataStoreName,
                                     String columnsDefinitions,
                                     String directory,
                                     SqlQuery sqlQuery) {
            this.externalTableName = externalTableName;
            this.dataStoreName = dataStoreName;
            this.columnsDefinitions = columnsDefinitions;
            this.directory = directory;
            this.sqlQuery = sqlQuery;
        }

        public String getType() {
            return "ExternalTableDatapump";
        }

        public List<AbstractSyntaxTree> getChildren() {
            List children = new ArrayList(0);
            return children;
        }

        public AbstractSyntaxTree combineTree(AbstractSyntaxTree tree) throws GenerationException {
            return this;
        }

        public AbstractSyntaxTree cloneAST() throws GenerationException {
            ExternalTableDatapump extTableStatement = new ExternalTableDatapump(externalTableName,
                                                                                dataStoreName,
                                                                                columnsDefinitions,
                                                                                directory,
                                                                                (SqlQuery)sqlQuery.cloneAST());
            extTableStatement.resourceNames = resourceNames;
            extTableStatement.compatible = compatible;
            extTableStatement.parallelUnloaders = parallelUnloaders;
            extTableStatement.compression = compression;
            extTableStatement.compressionLevel = compressionLevel;
            return extTableStatement;
        }

        public List<Expression> getExpressions() {
            return null;
        }

        public void addPathPoint(MapConnectorPoint point) {

        }

        public void resetReferencePath() {

        }

        public String getQualifiedTableName() {
            return externalTableName;
        }

        public String getDataStoreName() {
            return dataStoreName;
        }

        public String getResourceNames() {
            return resourceNames;
        }

        public String getColumnsDefinitions() {
            return columnsDefinitions;
        }

        public String getDirectory() {
            return directory;
        }

        public String getSelectSql() {
            return sqlQuery.getText();
        }

        public String getCompatible() {
            return compatible;
        }

        public String getCompression() {
            return compression;
        }

        public String getCompressionLevel() {
            return compressionLevel;
        }

        public String getParallelUnloaders() {

            return parallelUnloaders;
        }

        public void setOptions(String compatible, String parallelUnloaders, String compression, String compressionLevel) {

            if (compatible != null && compatible.trim().length() != 0) {
              if (!compatible.equals("COMPATIBLE") && !compatible.equals("LATEST")) {
                compatible = "'" + compatible + "'";
              }
            }
            this.compatible = compatible.trim();

            this.parallelUnloaders = "<\\u0024="+parallelUnloaders+"\\u0024>";

            resourceNames = "<\\u0024 if ("+parallelUnloaders+" == 1)"+
                            "   out.print(\"'"+dataStoreName+".exp'\");"+
                            "else {"+
                            "   for (int i=0; i<"+parallelUnloaders+"; i++) {"+
                            "      if (i != 0) out.print(\",\");"+
                            "      out.print(\"'"+dataStoreName+"\"+i+\".exp'\");"+
                            "   }"+
                            "}"+
                            "\\u0024>";
            this.compression = compression;
            this.compressionLevel = compressionLevel;
        }

        public String getText(TemplateUtils templateUtils) throws GenerationException {
            String template = getSelectedTemplate(templateUtils);
            HashMap templateVar = getTemplateSubstitutionMap();

            try {
              String result = oracle.odi.mapping.generation.parser.TemplateParser.mainCodeParser(templateUtils, templateVar, template);
              return result;
            } catch (oracle.odi.mapping.generation.parser.ParseException e) {
              Throwable cause = e.getCause();
              if (cause instanceof GenerationException) {
                throw (GenerationException)cause;
              }
              throw new GenerationException("Template parser exception: " + e.getMessage(), e);
            }
        }

        public Map<String,Object> getTemplateSubstitutionMap() {
          HashMap<String,Object> templateVar = new HashMap<String,Object>();
          templateVar.put("statement", this);
          return templateVar;
        }

    }
